import React, { useRef, useState } from "react";
import Button from 'react-bootstrap/Button';

let AppTodo = () => {
    const [todos, setTodos] = useState(["google"])

let value = useRef()
console.log(value)

    return (
        <>
            <div className="container">
                <div className="todolist">
                <input ref={value} className="input"/>
                <Button className="btn" variant="outline-danger">Add</Button>
                <div className="list">
                    <ul>
                        {
                        todos.map((title, index) => {
                            return (
                            <div key={index}  className="boxlist">
                                <li>{title}</li>
                                <span>delete</span>
                            </div>
                            )
                          })
                        }
                    </ul>
                </div>
                </div>
            </div>
        </>
    )
}

export default AppTodo
